import './App.css';
import { BrowserRouter as Routers, Routes, Route } from 'react-router-dom';
import Home from './Components/Home';
import Login from './Components/Login';
import Register from './Components/Register';
import Write from './Components/Write';
import Post from './Components/Post';
import Error from './Components/Error';
import Navbar from './Components/Navbar';
import { useState } from 'react';
import BlogCard from './BlogCard';


function App() {
  var [logged, setlogged] = useState(true);

  return (
    <>

      <div id='container'>

        <Routers>
          <Navbar logged={logged} setlogged={setlogged} />
          <Routes>
            <Route exact path='/' element={<Home logged={logged} setlogged={setlogged} />} />
            <Route exact path='/login' element={<Login logged={logged} setlogged={setlogged} />} />
            <Route exact path='/register' element={<Register logged={logged} setlogged={setlogged} />} />
            <Route exact path='/write' element={<Write logged={logged} setlogged={setlogged} />} />
            <Route exact path='/post/:postID' element={<Post />} />
            <Route exact path='/post/:*' element={<Error logged={logged} setlogged={setlogged} />} />
          </Routes>
        </Routers>

      </div>

    </>
  );
}

export default App;
